import React from 'react'
import { Ellipsis } from 'react-bootstrap/esm/PageItem'

const ImgTest = ({el}) => {
    return (
       <>
              <div className="col-4 col-sm-6">

                     <img width="100%"
                    src={el.img}
                    alt={el.title}
                  />



        </div>
      </>
    )
}

export default ImgTest
